import { Button } from 'antd'
import { NextPage } from 'next'
import { api } from '../../api'
import { Organization } from '../../interfaces/organization'

// remebr to update interface on Organization
interface Props {
  organization: Organization
}

const Ong: NextPage<Props> = ({ organization }) => {
  console.log(organization)
  return (
    <div>
      <Button>Simple Button</Button>
      <Button type="primary">Primary Button</Button>
      <Button type="primary" shape="round">
        Primary Button Round
      </Button>
      <Button type="primary" shape="round" size="large">
        Primary Button Round
      </Button>
    </div>
  )
}

Ong.getInitialProps = async ({ query }) => {
  const slug = query.slug
  const request = await api.get(`/organizations/${slug}`)
  const response = request.data.data as Organization

  return { organization: response }
}

export default Ong
